def icon():
    from tempfile import mkstemp

    _icon = b""

    _, _temp = mkstemp()

    with open(_temp, "wb") as _file:
        from base64 import b64decode

        _file.write(b64decode(_icon))

    _icon2 = (_temp).replace("\\", "//")

    return _icon2


